import React, { useEffect, useState } from "react";

export default function App() {
  const [first, setfirst] = useState(1);

  let a = 1;

  useEffect(() => {
    console.log("test");
  }, [first]);

  setInterval(() => {
    console.log(a);
    setfirst(a++);
  }, 1000);

  return <div>test</div>;
}
